css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("rlslog.net"), url("http://rlslog.net/") 

{


DIV[style="width: 468px; height: 60px; float: right; padding: 6px;"] {display: none !important}

DIV[style="padding: 6px; width: 468px; height: 60px; float: right;"], #jcornerBigEmbed {display: none !important}

#home {background: #111 !important}

#content {background: #444 !important; -moz-border-radius: 10px !important;}

#title {background: #444 !important; -moz-border-radius: 10px !important;}

IFRAME {display: none !important}

#wrap, .entry {background: #444 !important; border: solid 1px #999 !important; -moz-border-radius: 10px !important;}

#sidebar {background: #222 !important; -moz-border-radius: 10px !important;}

OL {background: #222 !important}

UL {background: #222 !important; color: #777 !important}

#footer {background: #222 !important; color: #8fe6ff !important; -moz-border-radius: 10px !important;}

#title > A > IMG {position:relative; left: 270px !important; border: solid 1px #999 !important;}



a:link    { color: #8fe6ff !important}
a:visited { color: #999 !important}
a:active  { color: #999 !important}
a:hover   { color: #8fe6ff !important}
span  {color: #8fe6ff !important}
.entrybody p {color: #999 !important}
.entrybody ul {color: #666 !important}
.entrymeta {color: #777 !important}
.commenttext {color: #999 !important}






































}
